from collections import Counter

# Sliding Window Algorithm (어려움..)
# O(s) solution
# Runtime: 104 ms, faster than 76.35% of Python3
# Memory Usage: 14.8 MB, less than 65.92% of Python3

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        need = Counter(t)
        result, left, missing = "", 0, len(t)

        for right, char in enumerate(s, 1):
            missing -= need[char] > 0
            need[char] -= 1

            if missing == 0:
                while left < right and need[s[left]] < 0:
                    need[s[left]] += 1
                    left += 1

                if not result or right - left < len(result):
                    result = s[left:right]

                need[s[left]] += 1
                missing += 1
                left += 1

        return result


s = ""
t = ""

solution = Solution()
solution.minWindow(s, t)
